('2396','18','7917','Villa Jones',Null,'Einfamilien Haus mit Blick in die Bucht von Santa Ponsa zu verkaufen','33677','Dieses Einfamilienhaus wurde vor 1964 erstellt und 1995 saniert. Das Haus steht auf einem ca 1.255m² großen Grundstück und bietet ca 340m² Wohn-Nutzfläche. Im EG befinden sich eine Garage (1Auto), Hauswirtschafts-und Technikraum, 3 Schlafzimmer und 3 Badezimmer (davon 2 en Suite). Alle Zimmer haben Zugang zu einer großen Terrasse. Im 1. OG befinden sich Eingang mit Diele, Wohnzimmer, Esszimmer, Küche, Schlafzimmer mit Bad en Suite und ein weiteres Badezimmer mit Dusche. Von der Wohnzimmerterrasse aus hat man einen sehr schönen Blick über die Bucht von Santa Ponsa. Ausgestattet mit Klimaanlage w/k  und einer neuen Zentralheizung (Radiatoren) elektrisch, kann das Haus auch ganzjährig bewohnt werden. Im angelegten Garten hat es noch einen mit Terrassen umgebenen Pool. Zum kleinen Strand und zum Club Nautico in Santa Ponsa sind es nur wenige Gehminuten','33678','1300000','106','2015-11-03 12:07:02','106','2015-11-03 12:08:07',Null,'2507','121','1176',1,'1','0',Null,Null,Null,'33679',Null,'0','0','0',Null,'2015-11-03 12:17:46',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33680',Null,'33681',Null,'33682',Null,'33683','687642537','33684','0',0,'0');
